import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  height: 753px;
  background-color: #f7f8fa;
  width: 100%;
`;

function Section3() {
  return (
    <Wrapper>
      <div className="container"></div>
    </Wrapper>
  );
}

export default Section3;
